import React from "react";
import "../css/slider.css";

function MainPage() {
  return (
    <div>
      {/* 슬라이드 */}
      <div class="slider">
        <img src="" alt="이미지 없음"></img>
      </div>
      {/* 검색창 */}
      <form id="main_search">
        <input type="text" />
        <input type="submit" />
      </form>
      <div>새로운 프로젝트</div>
      <div>질문 목록</div>
    </div>
  );
}

export default MainPage;
